import React, {useState, useEffect} from 'react';
// Components
import MovieList from "./components/MovieList";
import 'normalize.css';
import './App.scss';



const App = () => {
  const api_key = "bf7a0d7e84fbc649f8d6f2819491a0d6"
  console.log(api_key)

useEffect(()=> {
  const data = fetch(`https://api.themoviedb.org/3/discover/movie?api_key=${api_key}&language=en-US&sort_by=popularity.desc&include_adult=false&include_video=false&page=1`)
  .then((response) => response.json()).then(data => console.log(data.results))

}, [])

  return (
    <div className="App">
      <h1>React Study Group Movie - Database</h1>
      <MovieList movies={data} />
    </div>
  );
}

export default App;
